\n        week = date.getDay();\r\n    switch (week) {\r\n        case 1:\r\n            week = \"星期一\"\r\n            break;\r\n        case 2:\r\n            week = \"星期二\"\r\n            break;\r\n        case 3:\r\n            week = \"星期三\"\r\n            break;\r\n        case 4:\r\n            week = \"星期四\"\r\n            break;\r\n        case 5:\r\n            week = \"星期五\"\r\n            break;\r\n        case 6:\r\n            week = \"星期六\"\r\n            break;\r\n        case 7:\r\n            week = \"星期日\"\r\n            break;\r\n    }\r\n    $(\".today\").append(\"今天是：\"+week+\",\"+year+\"-\"+month+\"-\"+day)\r\n</script>\r\n<div id=\"content-full\">\r\n<!--{/php168}-->\',\n  \'base_dir\' => \'/\',\n  \'template\' => \'ycsyy/core/header\',\n)','1627898697');
