e.getDate(),\r\n        week = date.getDay();\r\n    switch (week) {\r\n        case 1:\r\n            week = \"星期一\"\r\n            break;\r\n        case 2:\r\n            week = \"星期二\"\r\n            break;\r\n        case 3:\r\n            week = \"星期三\"\r\n            break;\r\n        case 4:\r\n            week = \"星期四\"\r\n            break;\r\n        case 5:\r\n            week = \"星期五\"\r\n            break;\r\n        case 6:\r\n            week = \"星期六\"\r\n            break;\r\n        case 7:\r\n            week = \"星期日\"\r\n            break;\r\n    }\r\n    $(\".today\").append(\"今天是：\"+week+\",\"+year+\"-\"+month+\"-\"+day)\r\n</script>\r\n<div id=\"content-full\">\r\n\r\n\r\n<link rel=\"stylesheet\" type=\"text/css\" href=\"{$SKIN}style.css\" />\r\n<!--中间内容部分-->\r\n<div class=\"breadbanner delmag\">\r\n	<div class=\"fluid\">\r\n		<div class=\"bigbanner\">\r\n			$label[bigbanner_daohan_gg]\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"maincon\">\r\n	<div class=\"container\">\r\n		<div class=\"column-location mb20 clearfix\">\r\n			您现在的位置： <a href=\"{$core.controller}\">首页</a>\r\n			<!--{foreach $parent_cats $v}-->\r\n			>> <a href=\"$v[url]\">$v[name]</a>\r\n			<!--{/foreach}-->\r\n			>> <a href=\"$CAT[url]\">$CAT[name]</a>\r\n		</div>\r\n		<div class=\"column-title clearfix\">\r\n			<!--{php $parent = end($parent_cats);$parent_name = $parent ? $parent[name]:$CAT[name];$parent_url = $parent ? $parent[url] : $CAT[url];}-->\r\n			$parent[name]\r\n		</div>\r\n		<!--{if empty($subcategories)}-->\r\n		<div class=\"party-list\">\r\n			<div class=\"list-title clearfix\">\r\n				<div class=\"title pull-left\">$CAT[name]</div> \r\n				<span class=\"more pull-right\"> \r\n					<!--{if $add_enable}--><a href=\"{$core.U_controller}/cms/item-add?cid=$cid&model=$CAT[model]\" target=\"_blank\">发表</a><!--{/if}-->\r\n				</span>\r\n			</div>\r\n			<div class=\"list-main\">\r\n				<div class=\"list-content\">\r\n					<!--{php include template($TEMP_OBJ, $CAT[\\\