v>\r\n					<div class=\"topinfo hidden-sm hidden-xs\">\r\n						<div class=\"search\">\r\n			                <form action=\"{$RESOURCE}/search\" target=\"_blank\" method=\"get\" name=\"form1\" id=\"form1\" class=\"search-form\">\r\n						        <input type=\"text\" class=\"form-control\" id=\"keyword\" name=\"word\" placeholder=\"输入关键字\">\r\n						        <input type=\"submit\" class=\"btn btn-default\" value=\"搜索\" id=\"button\" name=\"\">\r\n						    </form>\r\n			            </div>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n		<div class=\"navbar-collapse navbar-collapse-toolbar collapse navbar-main\" id=\"bs-example-navbar-collapse-1\" aria-expanded=\"false\" style=\"height: 1px;\">\r\n			<div class=\"container\">\r\n				<ul class=\"nav navbar-nav navlist\">\r\n					<!--{php $loadsystem = ($SYSTEM == $core->CONFIG[\\\'index_system\\\'] || $core->CONFIG[\\\'CoreMenu\\\'])? \\\'core\\\' : $this_system->name;}-->\r\n					<!--{php $navigation_menu = $CACHE->read(\\\'\\\', $loadsystem, \\\'navigation\\\');}-->\r\n					<!--{php $i=0;}-->\r\n					<!--{foreach $navigation_menu[\\\'menus\\\'] $k $v}-->\r\n					<!--{php $i++;}-->\r\n					<li class=\"dropdown\">\r\n						<!--{if empty($v[\\\'menus\\\']) && $core->CONFIG[\\\'ShowMenu\\\']}-->\r\n						<a class=\"dropdown-toggle on$i\" data-hover=\"dropdown\" href=\"$v[url]\"  aria-expanded=\"false\" role=\"button\" target=\"$v[target]\">$v[name]</a>\r\n						<!--{/if}-->\r\n						<!--{if !empty($v[\\\'menus\\\']) && $core->CONFIG[\\\'ShowMenu\\\']}-->\r\n						<a class=\"dropdown-toggle link on$i\" data-toggle=\"dropdown\" data-hover=\"dropdown\" href=\"$v[url]\"  aria-expanded=\"false\" role=\"button\" target=\"$v[target]\">$v[name]</a>\r\n						<ul class=\"dropdown-menu\" role=\"menu\">\r\n							<!--{php $j=0;}-->\r\n							<!--{foreach $v[\\\'menus\\\'] $k2 $v2}-->\r\n							<!--{php $j++;}-->\r\n							<li class=\"menu$j\"><a href=\"$v2[url]\" target=\"$v2[target]\">$v2[name]</a></li>\r\n							<!--{/foreach}-->\r\n						</ul>\r\n						<!--{/if}-->		\r\n					</li>\r\n					<!--{/foreach}-->\r\n				</ul>\r\n				<div class=\"topinfo2 visible-xs-block\">\r\n					<div class=\"search\">\r\n						<form action=\"{$core.STATIC_URL}/search\" target=\"_blank\" method=\"get\" name=\"form1\" id=\"form1\" class=\"search-form\">\r\n							<input type=\"text\" class=\"form-control\" id=\"keyword\" name=\"keyword\" placeholder=\"输入关键字\">\r\n							<input type=\"submit\" class=\"btn btn-default\" value=\"搜索\" id=\"button\" name=\"button\">\r\n						</form>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"fixednav hidden-xs\">\r\n	<div class=\"container\">\r\n		<div class=\"navbox clearfix\">\r\n			<ul id=\"menu_nav\">\r\n				<!--{php $loadsystem = ($SYSTEM == $core->CONFIG[\\\'index_system\\\'] || $core->CONFIG[\\\'CoreMenu\\\'])? \\\'core\\\' : $this_system->name;}-->\r\n				<!--{php $navigation_menu = $CACHE->read(\\\'\\\', $loadsystem, \\\'navigation\\\');}-->\r\n				<!--{php $i=0;}-->\r\n				<!--{foreach $navigation_menu[\\\'menus\\\'] $k $v}-->\r\n				<!--{php $i++;}-->\r\n				<li class=\"\" _t_nav=\"tabs$i\">\r\n					<a href=\"$v[url]\" class=\"on$i\">$v[name]</a>\r\n				</li>\r\n				<!--{/foreach}-->\r\n			</ul>\r\n		</div>\r\n	</div>\r\n</div>\r\n<script type=\"text/javascript\">\r\nvar USERNAME = get_username();\r\n$(document).ready(function(){\r\n	//**show_edit**//\r\n	init_labelshows(\\\'header_t\\\');\r\n})\r\n$(window).scroll(function(){\r\n	var scrollTop = $(window).scrollTop();\r\n	if(scrollTop > 140){\r\n		$(\\\'.fixednav\\\').css({display:\\\'block\\\'}).stop().animate({\\\'opacity\\\':\\\'1\\\',top:0},100);\r\n	}else{\r\n		$(\\\'.fixednav\\\').css({display:\\\'none\\\'}).stop().animate({\\\'opacity\\\':\\\'0\\\',top:\"-50px\"},100);\r\n	}\r\n});\r\n</script>\r\n<script type=\"text/javascript\">\r\n    var date = new Date();\r\n    var year = date.getFullYear(),\r\n        month = date.getMonth() + 1,\r\n        day = date.getDate(),\r\n        week = date.getDay();\r\n    switch (week) {\r\n        case 1:\r\n            week = \"星期一\"\r\n            break;\r\n        case 2:\r\n            week = \"星期二\"\r\n            break;\r\n        case 3:\r\n            week = \"星期三\"\r\n            break;\r\n        case 4:\r\n            week = \"星期四\"\r\n            break;\r\n        case 5:\r\n            week = \"星期五\"\r\n            break;\r\n        case 6:\r\n            week = \"星期六\"\r\n            break;\r\n        case 7:\r\n            week = \"星期日\"\r\n            break;\r\n    }\r\n    $(\".today\").append(\"今天是：\"+week+\",\"+year+\"-\"+month+\"-\"+day)\r\n</script>\r\n<div id=\"content-full\">\r\n<link rel=\"stylesheet\" type=\"text/css\" href=\"{$SKIN}style.css\" />\r\n<script type=\"text/javascript\" src=\"{$RESOURCE}/js/$SYSTEM/item/item.js\"></script>\r\n<script type=\"text/javascript\">\r\nvar item_id = $data[id],\r\n	model = \\\'$data[model]\\\',\r\n	item_cid = $data[cid],\r\n	verified = \\\\$_GET[\\\'verified\\\'] !== undefined ? (\\\\$_GET[\\\'verified\\\'] == 1 ? 1 : 0) : 1;\r\n\r\n$(function(){\r\n	if(get_cookie(\\\'IS_ADMIN\\\') == 1){\r\n		item_operation($(\\\'#operation\\\').show());\r\n	}\r\n});\r\n</script>\r\n<div class=\"breadbanner delmag\">\r\n	<div class=\"fluid\">\r\n		<div class=\"bigbanner\">\r\n			$label[bigbanner_daohan_gg]\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"maincon clearfix\">\r\n	<div class=\"container\">\r\n		<div class=\"column-location mb20 clearfix\">\r\n			您现在的位置： <a href=\"{$core.controller}\">首页</a>\r\n			<!--{foreach $parent_cats $v}-->\r\n			>> <a href=\"$v[url]\">$v[name]</a>\r\n			<!--{/foreach}-->\r\n			>> <a href=\"$CAT[url]\">$CAT[name]</a>\r\n		</div>\r\n		<div class=\"guide-box\">\r\n			<div class=\"slider-guide clearfix\">\r\n				$label[list_guide_con1]\r\n			</div>\r\n		</div>\r\n		<div class=\"column-nav clearfix\">\r\n			<!--{template $this_module step_category_jx11}-->\r\n		</div>\r\n		<div class=\"docker-visit\">\r\n			<div class=\"more pull-right\">\r\n				<span id=\"operation\" style=\"display: none; cursor: pointer;color:#0040ff;\">{$P8LANG[\\\'operation\\\']}>></span>\r\n			</div>\r\n			<div class=\"artcon\">\r\n				$data[content]\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<script type=\"text/javascript\">\r\n$(\".slider-guide .slick-guide\").slick({\r\n	autoplay: false,\r\n	infinite: false,\r\n	slidesToShow: 5,\r\n	slidesToScroll: 1,\r\n	speed: 500,\r\n	touchMove: false,\r\n	responsive: [\r\n		{\r\n			breakpoint: 768,\r\n			settings: {\r\n				autoplay: false,\r\n				infinite: false,\r\n				slidesToShow: 3\r\n\r\n			}\r\n		}\r\n	]\r\n});\r\n</script>\r\n<script type=\"text/javascript\" src=\"{$STATIC_URL}/search/count.php?id=$data[id]\"></script>\r\n<!--{template $this_system footer}-->\r\n<!--{/php168}-->\',\n  \'base_dir\' => \'ycsyy/cms/item/\',\n  \'template\' => \'page/list_mzpb\',\n)','1628215079');
